class NewUserAgent:
    def __init__(self):
        self.kernel = None
        self.engine = None
        self.browser = None
        self.browsers = None
        self.run()

    # 处理宏宇给的ua列表
    def process_list(self):
        kernel, engine, browser = [], [], []
        for item in user_agent_list:
            separate = item.split(') ')
            if len(separate) == 3:  # 目前仅仅采用操作系统，渲染引擎和浏览器版本这种形式
                kernel.append(separate[0] + ') ')
                engine.append(separate[1] + ') ')
                br = separate[2].split()
                browser.extend(br)
            else:
                pass
        self.kernel, self.engine, self.browser = list(set(kernel)), list(set(engine)), list(set(browser))

    def parse_kernal(self):
        pass

    # 处理浏览器版本低的问题
    def parse_browser(self):
        browsers = list()
        for b in self.browser:
            br = b.split('/')
            if len(br) == 2:
                if br[0] == 'Chrome':
                    version_number = br[1].split('.')[0]
                    if int(version_number) > 60:
                        browsers.append(b)
                else:
                    browsers.append(b)
        self.browsers = browsers

    def product_user_agent(self):
        k = random.choice(self.kernel)
        e = random.choice(self.engine)
        b = random.choice(self.browsers)
        return k + e + b

    # 代码主逻辑
    def run(self):
        self.process_list()
        self.parse_browser()


